              start={"From 799"}
            />
          </div>
        </div>
        <div className="product-catalog">
          <Heading title={"Fashion"} heading={"Trending Fashion"} />
          <div className="grid grid-cols-8 gap-10">
            <FashionCard image={fa1} />
